Club Sandy - Blue Angel - Heaven or Hell

Released : July 5, 2011

The angelic Blue Angel spreads her heavenly love to every willing soul, even for those who fell from grace long ago. The devilish Kristian Devil, on the other side, wants to prove Blue Angel that the real satisfaction and pleasures are coming from below. If you ever wondered where the truth lies, here is the chance to find out.
